import React, { Component } from 'react';
import './App.css';
import TodoItem from './components/TodoItem';
class App extends Component {
  constructor() {
    super();
    this.todoItems = [
        { title : 'Job 1', isCompleted : true },
        { title : 'Job 2', isCompleted : true },
        { title : 'Job 3', isCompleted : false }
    ];
    this.state = this.todoItems[0];
    this.todoItems[0] = { title : 'Job 1', isCompleted : true };
    this.onItemClicked = this.onItemClicked.bind(this);
  }

  onItemClicked() {
    this.setState = { title : 'Job 4', isCompleted : false };
    this.todoItems[0] = this.state;
  }

  render() {
    return (
      <div className="App"> 
        {
          this.todoItems.map((item, index) => 
            <TodoItem key={index} item={item} onClick={this.onItemClicked()}/>)
        }
      </div>
    );
  }

}

export default App;
